const EducationCourses = () => {
	return(		
		<div className="tc">
			<div class="mw9 center ph3-ns">
			  <div class="cf ph1-ns">
				    <div class="fl w-10 w-50-ns pa2">
				      <div class="outline bg-white pv4">
				      	<	p>Languages: </p>
				      </div>
				    </div>
				    <div class="fl w-90 w-50-ns pa2">
