				      	<p>Computer skills: HTML, CSS, Javascript, Python, NPM, Github, React, SQL, PostgreSQL, Bootstrap, Node.js </p>
				      </div>
				    </div>
			  </div>
			</div>



    </div> 	   
	);
}

export default EducationCourses;
